import React, { Component } from "react";
import "./App.css";

class Counter extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      title: "Hello Kyrgyzstan",
      count: 0,
    };
  }

  render() {
    return <div>{this.state.title}</div>;
  }
}

export default Counter;
